  [],\n\t\"revision_timestamp\": \"2015-09-26T23:56:29.379203\",\n\t\"name\": \"ghrsst-level-4-odyssea-mediterranean-sea-regional-foundation-sea-surface-temperature-analysis-g\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A Group for High Resolution Sea Surface
  Temperature (GHRSST) Level 4 sea surface temperature analysis produced daily on
  an operational basis at Ifremer/CERSAT (France) using optimal interpolation (OI)
  on a regional 0.02 degree grid. It provides a daily cloud-free field of foundation
  sea surface temperature at approximately 2 km resolution (0.02 degree) for the Mediterranean
  Sea. It is generated by merging microwave and infrared satellite sea surface temperature
  observations including those from the Advanced Very High Resolution Radiometer (AVHRR),
  the Advanced Along Track Scanning Radiometer (AATSR), the Spinning Enhanced Visible
  and Infrared Imager (SEVIRI), the Advanced Microwave Scanning Radiometer-EOS (AMSRE),
  the Tropical Rainfall Measuring Mission Microwave Imager (TMI) and the Geostationary
  Operational Environmental Satellite (GOES) Imager. The satellite SST observations
  are intercalibrated using the AATSR sensor as a reference (previously re-calibrated
  using all available in situ data). The development of the global real-time sea surface
  temperature at Ifremer/CERSAT is supported by European Commission initially in the
  frame of MERSEA project. This dataset supersedes the original Level 4 product for
  this region: GHRSST Level 4 EUR Mediterranean Sea Regional Foundation Sea Surface
  Temperature Analysis.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
